import styled from 'styled-components';

const StartButton = styled.button`
    background: rgb(220, 190, 95);
	padding: 0.5rem;
	height: 3rem;
	width: 5rem;
	margin: auto;
	border: 2px solid rgb(80, 65, 25);
	border-radius: 0.5rem;
`;

export { StartButton };
